●Terzoの業務用キャリア レインモール用8本脚タイプ EA900H<br>●ベースキャリアとラックがセットになった業務用キャリアのオールインワンキット<br>●装着の仕方はベースキャリアを車に装着してからラックを装着する、簡単取付<br>●Terzoの品質をそのままに防錆性・耐久性も抜群<br><br>☆業務用キャリア用オプション ラインアップ<br>フロアパイプ2本セット → TP2400(147cm) / TP2401(137cm)<br>パネルエンドカバー LRセット → TP2402<br>パネルセンター カバーセット → TP2403<br>アッパー&アンダー パネルセット → TP2404<br>バー固定ステイ アッシー2個セット → TP2405<br><br>☆主な適合車種<br>H1.8～H16.7 LH/RZH/TRH10#～18# ハイエース(バン標準ルーフ)<br>H16.8～ KDH/TRH20#V ハイエース(バン標準ルーフ)<br>H11.7～H16.7 LH/RZH/TRH10#～18# レジアスエースバン(標準ルーフ)<br>H13.5～H24.5 E25 キャラバン(標準ルーフ)<br>H11.6～ SK# バネットバン(標準ルーフ)<br>H11.11～H23.9 SK22#/82# デリカバン(標準ルーフ)<br>H11.6～ SK# ボンゴバン(標準ルーフ)<br>H8.11～ CR/KR4#J/5#J デルタバン(標準ルーフ)<br>H13.5～H24.6 E25 コモ(標準ルーフ)<style type="text/css">
