●Terzoの業務用キャリア レインモール用6本脚タイプ EA900K<br>●ベースキャリアとラックがセットになった業務用キャリアのオールインワンキット<br>●装着の仕方はベースキャリアを車に装着してからラックを装着する、簡単取付<br>●Terzoの品質をそのままに防錆性・耐久性も抜群<br><br>☆業務用キャリア用オプション ラインアップ<br>フロアパイプ2本セット → TP2400(147cm) / TP2401(137cm)<br>パネルエンドカバー LRセット → TP2402<br>パネルセンター カバーセット → TP2403<br>アッパー&アンダー パネルセット → TP2404<br>バー固定ステイ アッシー2個セット → TP2405<br><br>☆主な適合車種<br>H23.12～ S321M/331M# ピクシスバン(標準ルーフ/ハイルーフ)<br>H11.6～ SK# バネットバン(標準ルーフ)<br>S61.9～H13.4 E24 ホーミー(バン標準ルーフ)<br>H11.11～H23.9 SK22#/82# デリカバン(標準ルーフ)<br>H17.9～H27.2 DG64V スクラムバン(ハイルーフ)<br>H11.6～ SK# ボンゴバン(標準ルーフ)<br>H24.4～ S321B/331B サンバーバン<br>H17.8～H27.1 DA64V/DA64W エブリイ(標準ルーフ/ハイルーフ)<br>H16.12～ S32#/33# ハイゼットカーゴ(ロールーフ/ハイルーフ)<style type="text/css">
